import { techMastered } from "../techs/techMastered.component";

import './techCardCollection.style.css'

const TechCollection = () => {
  return(
    <div className="techCollection_container">
      {
        techMastered.map((Tech, index) => {
          return <div style={{'width': '100px','height':'100px'}}><Tech/></div>
        })
      }
    </div>
  )
}

export default TechCollection;



